import { useEffect } from "react";

function Products() {
  const getDet = () => {
    fetch("http://localhost:8080/categories")
      .then((response) => response.json())
      .then((allDet) => console.log(allDet));
  };

  useEffect(() => {
    getDet();
  }, []);
  return (
    <div className="container products my-4">
      <h1 className="text-center">Products</h1>
      <div className="row row-cols-2 row-cols-sm-3 row-cols-lg-5">
        <div className="col mb-4">
          <div className="card" style={{ width: "10rem", border: "none", cursor: "pointer" }}>
            <img src="" className="card-img-top" alt="..." style={{ borderRadius: "50%" }} />
            <div className="card-body">
              <h5 className="card-title text-center">Title</h5>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
};
export default Products;
